export class About extends Component {
    render() {
        return (
            <div>
                <div className="card">
                    <img className="card-img-top" src="images/about01.png" alt="Card image" />
                    <div className="card-body">
                        <h4 className="card-title">Michelle Littlefield</h4>
                        <p className="card-text">Sola Salon</p>
                        <p className="card-text">Stylist</p>

                    </div>
                </div>
            </div>
        )
    }
}

export default About
